import './FormEditing.css'
import backArrow from '../../images/assets/icon-arrow-down.svg';
import {formatDate} from '../InvoiceDetails/InvoiceDetails'


const EditFormContainer = ({form}) => {
    return (
      <div className='Editting-Form-Wrapper'>
        <EditForm form={form}/>
        <EditFormFooter form={form} />
      </div>
    );
};


const EditForm = ({form}) => {
    return (
        <div className='Editting-Form-Wrapper'>
            <div
                className={`return-page-wrapper`}
            >
                <img src={backArrow} alt=''/>
                Go back
            </div>
            <div className='Editing-Form'>
                <h2>Edit <span>#</span>{form.id}</h2>
                <BillForm form={form} />
                <BillTo form={form} />
                <ItemList form={form} />
            </div>
        </div>
    );
};

const BillForm = ({form}) => {
    return (
        <div className='Bill-From-Wrapper'>
            <h4 className='billing-header' id='bill-from'>Bill From</h4>
            <div className='Street-Address-Container form-container'>
                <label htmlFor='street'>Street Address</label>
                <input type='text' name='street' placeholder={form.senderAddress.street}/>
            </div>
            <div className='City-Postcode-Wrapper'>
                <div className='City-Container form-container'>
                    <label htmlFor='city'>City</label>
                    <input type='text' name='city' placeholder={form.senderAddress.city} />
                </div>
                <div className='Postcode-Container form-container'>
                    <label htmlFor='postCode'>Post Code</label>
                    <input type='text' name='postCode' placeholder={form.senderAddress.postCode} />
                </div>
            </div>
            <div className='Country-Container form-container'>
                <label htmlFor='country'>Country</label>
                <input type='text' name='country' placeholder={form.senderAddress.country} />
            </div>
        </div>
    );
};

const BillTo = ({form}) => {
    return (
        <div className='Bill-To-Wrapper'>
            <h4 className='billing-header' id='bill-to'>Bill To</h4>
            <div className='Name-Container form-container'>
                <label htmlFor='clientName'>Client's Name</label>
                <input type='text' name='clientName' placeholder={form.clientName}/>
            </div>
            <div className='Email-Container form-container'>
                <label htmlFor='clientEmail'>Client's Email</label>
                <input type='text' name='clientEmail' placeholder={form.clientEmail} />
            </div>
            <div className='Street-Address-Container form-container'>
                <label htmlFor='street'>Street Address</label>
                <input type='text' name='street' placeholder={form.senderAddress.street}/>
            </div>
            <div className='City-Postcode-Wrapper'>
                <div className='City-Container form-container'>
                    <label htmlFor='city'>City</label>
                    <input type='text' name='city' placeholder={form.senderAddress.city} />
                </div>
                <div className='Postcode-Container form-container'>
                    <label htmlFor='postCode'>Post Code</label>
                    <input type='text' name='postCode' placeholder={form.senderAddress.postCode} />
                </div>
            </div>
            <div className='Country-Container form-container'>
                <label htmlFor='country'>Country</label>
                <input type='text' name='country' placeholder={form.senderAddress.country} />
            </div>
            <div className='invoice-date-container form-container'>
                <label htmlFor='invoice-date' id='invoice-date-label'>Invoice Date</label>
                <input type='text' name='invoice-date' placeholder={formatDate(form.createdAt)} />
            </div>
            <div className='payment-terms-container form-container'>
                <label htmlFor='payment-terms' id='payment-terms-label'>Payment Terms</label>
                <select name='payment-terms'> 
                    <option value='1'>Net 1 Day</option>
                    <option value='7'>Net 7 Days</option>
                    <option value='14'>Net 14 Days</option>
                    <option value='30'>Net 30 Days</option>
                </select>
            </div> 
            <div className='project-description-container form-container'>
                <label htmlFor='project-description' id='project-description-label'>Project Description</label>
                <input type='text' name='project-description' placeholder={form.description} />
            </div>
        </div>
    )
};

const ItemList = ({form}) => {
    return (
        <div className='ItemList-Wrapper'>
            <h3 id='item-list'>Item List</h3>

            {form.items.map((item, index) => {
                return (
                    <div className='Item-Wrapper form-container' key={index}>
                        <label htmlFor='item-name' id='item-name-label'>Item Name</label>
                        <input type='text' name='item-name' placeholder={item.name} />
                        <div className='Item-Contents-Wrapper'>
                            <div className='Qty-Container form-container'>
                                <label htmlFor='qty'>Qty</label>
                                <input type='number' name='qty' placeholder={item.quantity}/>
                            </div>
                        </div>
                    </div>
                )
            })}

        </div>
    );
};


const EditFormFooter = ({form}) => {
    return (
        <div className='Edit-Form-Footer'></div>
    )
};


export default EditFormContainer;
